import React from "react";
import "./contactus.css";
import axios from "axios";

function ContactUs() {
  axios.create({
    usrl: "localhost:1234/test",
    responseType: "json"
  });

  function send() {
    document.getElementById("sendBtn").innerHTML = "SENDING";
    var data = {
      fullName : "ade",
      email : "omos",
      msg : "hello"
    };
    axios.get({
        url: "localhost:5000/contactus/send",
        body: data,
        method: "get"
      })
      .then(() => {
        console.log("hello");
      })
      .catch(() => {
        console.log("error");
      });
  }
  return (
    <div>
      <section
        className="section-contactus"
        data-aos="flip-down"
        aos-duration="500"
        style={{ zIndex: "1" }}
      >
        <div className="contact">CONTACT US</div>
        <div className="page">
          <div className="cardBody-contact contactus">
            <div className="hi">
              <p className="hi2">Please kindly fill in the form below</p>
            </div>
            <div className="inputBox-contact">
              {/* <div>Firstname</div> */}
              <input
                type="text"
                className="input-contact"
                placeholder="Your full name"
              />
            </div>

            <div className="inputBox-contact">
              <input
                type="text"
                className="input-contact"
                placeholder="Your contact email"
              />
            </div>

            <div className="inputBox-contact">
              <input
                type="text"
                className="input-contact"
                placeholder="Your Message"
                style={{ height: "8em" }}
              />
            </div>

            <div className="below">
              <div className="submitBox">
                <button
                  className="submitBtn-contact"
                  onClick={send}
                  id="sendBtn"
                >
                  SEND
                </button>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default ContactUs;
